import React from "react";
// import "./style.css";

const SearchBar = ({ onSearchInputChange }) => {
  return (
    <div id="searchContainer">
      <input
        type="text"
        id="searchBar"
        placeholder="Search..."
        onChange={(e) => onSearchInputChange(e.target.value)}
      />
      <button id="searchButton">Search</button>
    </div>
  );
};

export default SearchBar;
